import React, {Component} from 'react';

class App extends Component {
  render(){
    return(
        <div>
          <h1> Minha rede social </h1>
          <div>
            <h3>Texto do post</h3>
            <small>15:00</small>
            <p> Likes: 0 </p>
            <button>Like</button>
          </div>

        </div>
    )
  }
}

export default App;
